import React from "react";
import { Skeleton } from "@mui/material";
import Stack from "@mui/material/Stack";

const Skel = () => {
    return (
        <>
            <Stack spacing={2} style={{ width: "22rem" ,marginTop: 200 }} >
                <Skeleton variant="rectangular" animation="wave" width={"350px"} height={350}  />
                <Skeleton variant="rectangular" animation="wave" width={"2rem"} height={200} />
            </Stack>


        </>
    )
}

export default Skel;
